import './App.css';
import ApolloClient from 'apollo-boost'
import Messages from './components/Messages';
import { Navbar } from './components/Navbar';
import { NavItem } from './components/NavItem';
import {DropdownMenu} from './components/Dropdown'
import { ReactComponent as SwearIcon } from './icons/swear.svg';
import { ReactComponent as NoteIcon } from './icons/note.svg';
import { ReactComponent as GroupIcon } from './icons/group.svg';
import { ReactComponent as ProfileIcon } from './icons/profile.svg';

export const client = new ApolloClient({
  uri: 'http://localhost:4000/graphql'
});

function App() {
  return (
      <div className="App">
        <Navbar>
          <NavItem icon={<SwearIcon/>} />
          <NavItem icon={<NoteIcon/>} />
          <NavItem icon={<GroupIcon/>} />
          <NavItem icon={<ProfileIcon/>}>
            <DropdownMenu>

            </DropdownMenu>
          </NavItem>
        </Navbar>
        <Messages/>
      </div>
  );
}


export default App;
